    focusInvalidInput(form) {
        for (const key of Object.keys(form.controls)) {
            if (form.controls[key].invalid) {
                const invalidControl = this.el.nativeElement.querySelector('[formcontrolname="' + key + '"]');
                if (invalidControl) {
                    invalidControl.focus();
                }
                break;
            }
        }
    }
